import React, { Component } from "react";

class Header extends Component {

    render() {
        return (
            <div>
                <header id={"header"}>
                    <p id={"header_text"}>Easy Sender</p>
                    <nav id={"nav_panel"}>
                        <p>Add</p>
                        <p>Modify</p>
                        <p>Use</p>
                    </nav>
                </header>
            </div>
        )
    }
}

export default Header
